import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'
import Homepage from './components/Homepage/Homepage'
import RouteSelection from './components/RouteSelection/RouteSelection'

import LogiSignup from './components/Login-Signup/LogOrsign'
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact render={props => <Homepage {...props} />} />

          <Route path="/Admin" exact render={props => <LogiSignup {...props} />} />
          <Route path="/Admin/home" exact render={props => <LogiSignup {...props} />} />
          <Route path="/routes" exact render={props => <RouteSelection {...props} />} />

        </Switch>
      </Router>
    </div>

  );
}

export default App;
